import React from 'react'

export default function PauseResumeButton(props) {

    return (
        <div>
            <div className='btnContainer' >
                <div to="/Heatup" className="testButton" onClick = {()=>{props.setPauseTimer(true)}}>{'Pause'}</div>
            </div>
        </div>
    )
}
